import Typography from '@mui/material/Typography';
import PetTable from './Components/PetTable/PetTable';
import {useState} from 'react';

function App() {

  var startingPets = getPetTable();
  const[pets, setPets] = useState(startingPets);

  const handleAddPet = (name, age, species) => {
    var petIds = pets.map(pet => pet.id);
    var highestId = Math.max(...petIds);

    var pet = {
      id: highestId +1,
      name: name,
      age: age,
      species: species
    }

    setPets([...pets, pet])
  } 
  return (
    <div className="App">
        <Typography variant="h2">Welcome to Pet-a-dex, the Pet organization solution.</Typography>
        <PetTable pets={pets}/>
    </div>
  );

  function getPetTable(){

    let petArray = [
      {
        id: 1,
        name: "rex",
        age: 3,
        species: "labrapoodle",
      },
      {
        id: 2,
        name: "Porkchop",
        age: 12,
        species: "pig",
      }
    ]

    return(petArray);
  }
}

export default App;
